response.about:
Практикующий психолог. 
Гештальт-терапевт. 

Индивидуальные консультации по следующим вопросам:

- Депрессии, апатии, состояние внутренней пустоты;
- Страхи, фобии, тревоги, панические атаки;
- Психосоматические заболевания;
- Проблемы во взаимоотношениях с близкими;
- Острые стрессовые расстройства как следствие переживания кризисной ситуации;

Семейные консультации по вопросам:

- Сложности в отношениях между супругами;
- Проблемное поведение детей и подростков;
